import React from 'react'
import {
    Icon, MenuItem, Search, Header,
    Image,
    Menu,
    Segment,
    Sidebar, SidebarPusher,
    SidebarPushable,
} from 'semantic-ui-react'


const Topbar = () => {
    return (
        <div className='navbars'>
            <div className='topbar'>
                <Menu stackable style={{ width: "100%" }} >
                    <MenuItem>
                        <img alt='logo' src='https://react.semantic-ui.com/logo.png' />
                    </MenuItem>
                    <MenuItem
                    //   active={activeItem === 'features'}
                    // onClick={this.handleItemClick}
                    >
                        Title
                    </MenuItem>

                    <MenuItem
                        name='testimonials'
                    //   active={activeItem === 'testimonials'}
                    // onClick={this.handleItemClick}
                    >
                        Testimonials
                    </MenuItem>

                    <MenuItem
                        name='sign-in'
                    //   active={activeItem === 'sign-in'}
                    // onClick={this.handleItemClick}
                    >
                        Sign-in
                    </MenuItem>
                </Menu>
            </div>
            <div className='sidebar'>
                <Menu vertical floated style={{width:"10%",height:'100%'}}>
                    <MenuItem>
                        <Icon name='home' />
                        Home
                    </MenuItem>
                    <MenuItem>
                        <Icon name='gamepad' />
                        Games
                    </MenuItem>
                    <MenuItem>
                        <Icon name='camera' />
                        Channels
                    </MenuItem>
                </Menu>
                <h1>hello</h1>
            </div>

        </div>
    )
}

export default Topbar
